import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { 
  Package, 
  Users, 
  ShoppingCart, 
  TrendingUp, 
  Clipboard 
} from 'lucide-react';
import { useNavigate } from 'react-router-dom'; // Tambahkan import ini

const DashboardAdmin = () => {
  const [orders, setOrders] = useState([]);
  const [users, setUsers] = useState([]);
  const navigate = useNavigate(); // Tambahkan hook navigate

  // ... (useEffect dan fungsi lainnya tetap sama)

  return (
    <div className="container mx-auto p-5 mt-12 bg-gray-50">
      {/* ... (bagian lain tetap sama) */}

      {/* User Management */}
      <div className="bg-white p-6 rounded-xl shadow-md">
        <div className="flex justify-between items-center mb-4">
          <h3 className="text-xl font-semibold text-gray-800">User Management</h3>
          <Users className="text-green-500" size={24} />
        </div>
        <div className="overflow-x-auto">
          <table className="w-full text-sm text-left">
            <thead className="bg-gray-100 text-gray-600">
              <tr>
                <th className="p-3">Nama</th>
                <th className="p-3">Email</th>
                <th className="p-3">Role</th>
              </tr>
            </thead>
            <tbody>
              {users.map(user => (
                <tr 
                  key={user.id} 
                  className="border-b hover:bg-gray-50 cursor-pointer" // Tambahkan cursor-pointer
                  onClick={() => navigate(`/profile/${user.id}`)} // Tambahkan onClick handler
                >
                  <td className="p-3">{user.nama}</td>
                  <td className="p-3">{user.email}</td>
                  <td className="p-3">{user.role}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default DashboardAdmin;
